import styled, {keyframes} from 'styled-components';
import {Link} from 'react-router-dom';

const shaking = keyframes`
    from {
        rotate: 0;
    }
    25% {
        rotate: -45deg
    }
    50 {
        rotate: 0
    }
    to {
        rotate: 45deg
    }
`;

const styleLink = styled(Link)`
    cursor: pointer;
    &:hover {
        color: orange;
    };
    & img {
        animation: ${shaking} linear .2s;
    }
`

function TagLink(logo, link, text) {
    return (
        <styleLink l>
            <img src={logo} alt=""/>
            {text}
        </styleLink>
    )
}

export default TagLink;
